import {gql} from '@apollo/client';
import {graphql} from '@apollo/client'

const getBookListQuery = gql`
  {
    books{
      id
      name
    }
  }
`
function BookList() {
  console.log(this.props);
  return (
    <div>
      <ul id='book-list'>
        <li>Book name</li>
      </ul>
    </div>
  );
}

export default graphql(getBookListQuery)(BookList);
